import React, { useEffect, useState } from 'react';
import { getEvent, updateEvent } from '../api';

export default function UpdateEvent({ id, user, onBack }){
  const [event, setEvent] = useState(null);
  const [location, setLocation] = useState('');
  const [start, setStart] = useState('');
  const [end, setEnd] = useState('');
  const [attendees, setAttendees] = useState(0);
  const [photos, setPhotos] = useState([]);
  const [media, setMedia] = useState([]);
  const [video, setVideo] = useState(null);
  useEffect(()=>{ load(); }, []);
  async function load(){
    const e = await getEvent(id);
    setEvent(e);
    setLocation(e.location || '');
    setStart(e.start_datetime || '');
    setEnd(e.end_datetime || '');
    setAttendees(e.attendees_count || 0);
  }
  async function submit(e){
    e.preventDefault();
    const fd = new FormData();
    fd.append('location', location);
    fd.append('start_datetime', start);
    fd.append('end_datetime', end);
    fd.append('attendees_count', attendees);
    fd.append('userId', user.id);
    for (const f of photos) fd.append('photos', f);
    for (const f of media) fd.append('media_photos', f);
    if (video) fd.append('video', video);
    const res = await updateEvent(id, fd);
    if (res.error) alert(res.error); else { alert('अपडेट सफल'); onBack(); }
  }
  if (!event) return <div>लोड हो रहा है...</div>;
  return (
    <div>
      <button className='button secondary' onClick={onBack}>वापस</button>
      <h3>इवेंट अपडेट करें</h3>
      <form onSubmit={submit}>
        <div><label>स्थान: <input value={location} onChange={e=>setLocation(e.target.value)} /></label></div>
        <div><label>शुरू तिथि और समय: <input value={start} onChange={e=>setStart(e.target.value)} placeholder='YYYY-MM-DD HH:MM:SS' /></label></div>
        <div><label>समाप्त तिथि और समय: <input value={end} onChange={e=>setEnd(e.target.value)} placeholder='YYYY-MM-DD HH:MM:SS' /></label></div>
        <div><label>हाज़िरी की संख्या: <input type='number' value={attendees} onChange={e=>setAttendees(e.target.value)} /></label></div>
        <div><label>Photos (अधिकतम 10): <input type='file' multiple accept='image/*' onChange={e=>setPhotos(e.target.files)} /></label></div>
        <div><label>Media coverage photos (अधिकतम 5): <input type='file' multiple accept='image/*' onChange={e=>setMedia(e.target.files)} /></label></div>
        <div><label>Video (कम से कम 10MB): <input type='file' accept='video/*' onChange={e=>setVideo(e.target.files[0])} /></label></div>
        <div style={{marginTop:10}}><button className='button' type='submit'>अपडेट भेजें</button></div>
      </form>
    </div>
  );
}
